  localization_strings_Main_Constants_15: '\u0627\u0644\u0641\u0631\u0634\u0627\u0629 \u0627\u0644\u062c\u0627\u0646\u0628\u064a\u0629 \u0645\u062d\u0634\u0648\u0631\u0629.',
  localization_strings_Main_Constants_14:
    '\u0646\u0638\u0641 \u0627\u0644\u0641\u0631\u0634\u0627\u0629 \u0627\u0644\u0631\u0626\u064a\u0633\u064a\u0629 \u0648\u0627\u0644\u0645\u062d\u0627\u0645\u0644 \u0648\u0623\u0639\u062f \u0627\u0644\u062a\u0634\u063a\u064a\u0644.',
  localization_strings_Main_Constants_13:
    '\u0646\u0638\u0641 \u0627\u0644\u0641\u0631\u0634\u0627\u0629 \u0627\u0644\u0631\u0626\u064a\u0633\u064a\u0629 \u0648\u0627\u0644\u0645\u062d\u0627\u0645\u0644.',
  localization_strings_Main_Constants_12: '\u0627\u0644\u0641\u0631\u0634\u0627\u0629 \u0627\u0644\u0631\u0626\u064a\u0633\u064a\u0629 \u0645\u062d\u0634\u0648\u0631\u0629.',
  localization_strings_Main_Constants_11:
    '\u062a\u0648\u0642\u0641 \u0627\u0644\u0631\u0648\u0628\u0648\u062a. \u063a\u064a\u0631 \u0645\u0643\u0627\u0646\u0647 \u0648\u0623\u0639\u062f \u0627\u0644\u062a\u0634\u063a\u064a\u0644 \u0623\u0648 \u0646\u0638\u0641 \u0645\u0633\u062a\u0634\u0639\u0631\u0627\u062a \u0627\u0644\u0645\u0646\u062d\u062f\u0631\u0627\u062a \u0644\u062a\u0635\u062d\u064a\u062d \u0647\u0630\u0627 \u0627\u0644\u062e\u0637\u0623.',
  localization_strings_Main_Constants_10:
    '\u0646\u0638\u0641 \u0645\u0633\u062a\u0634\u0639\u0631\u0627\u062a \u0627\u0644\u0645\u0646\u062d\u062f\u0631\u0627\u062a\u060c \u0648\u062d\u0631\u0643 \u0627\u0644\u0631\u0648\u0628\u0648\u062a \u0628\u0639\u064a\u062f\u064b\u0627 \u0639\u0646 \u0627\u0644\u0645\u0646\u062d\u062f\u0631 \u0648\u0623\u0639\u062f \u0627\u0644\u062a\u0634\u063a\u064a\u0644. ',
  localization_strings_Main_Constants_9: '\u062e\u0637\u0623 \u0641\u064a \u0645\u0633\u062a\u0634\u0639\u0631\u0627\u062a \u0627\u0644\u0645\u0646\u062d\u062f\u0631\u0627\u062a',
  localization_strings_Main_Constants_7:
    '\u063a\u064a\u0631 \u0645\u0643\u0627\u0646 \u0627\u0644\u0631\u0648\u0628\u0648\u062a \u0648\u0623\u0639\u062f \u0627\u0644\u062a\u0634\u063a\u064a\u0644.',
  localization_strings_Main_Constants_6: '\u062a\u0648\u0642\u0641 \u0627\u0644\u0639\u062c\u0644\u0627\u062a',
  localization_strings_Main_Constants_5:
    '\u0627\u0644\u0645\u0635\u062f \u0639\u0627\u0644\u0642. \u0642\u0645 \u0628\u062a\u0646\u0638\u064a\u0641\u0647 \u0648\u0627\u0636\u063a\u0637 \u0628\u0631\u0641\u0642 \u0644\u062a\u062d\u0631\u064a\u0631\u0647. \u0641\u064a \u062d\u0627\u0644\u0629 \u0639\u062f\u0645 \u0648\u062c\u0648\u062f \u0623\u064a \u0639\u0627\u0626\u0642\u060c \u063a\u064a\u0631 \u0645\u0643\u0627\u0646 \u0627\u0644\u0631\u0648\u0628\u0648\u062a \u0648\u0623\u0639\u062f \u0627\u0644\u062a\u0634\u063a\u064a\u0644.',
