    '\u064a\u062a\u0645 \u0628\u062f\u0621 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u062a\u062d\u0631\u0643. \u064a\u062a\u0645 \u0627\u0644\u0643\u062a\u0645 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627. \u0648\u064a\u062a\u0645 \u0625\u0644\u063a\u0627\u0621 \u0627\u0644\u0643\u062a\u0645 \u0639\u0646\u062f \u0627\u0644\u0636\u0631\u0648\u0631\u0629.',
  carpet_clean_mode_detail4:
    '\u064a\u0646\u0637\u0628\u0642 \u0639\u0644\u0649 \u0627\u0644\u062d\u0635\u064a\u0631 \u0623\u0648 \u0627\u0644\u0633\u062c\u0627\u062f \u0635\u063a\u064a\u0631 \u0627\u0644\u062d\u062c\u0645. \u0639\u0646\u062f \u0627\u0643\u062a\u0634\u0627\u0641 \u0633\u062c\u0627\u062f\u0629\u060c \u064a\u062a\u0645 \u0631\u0641\u0639 \u0627\u0644\u0645\u0645\u0633\u062d\u0629 \u0648\u0625\u064a\u0642\u0627\u0641 \u062a\u062f\u0641\u0642 \u0627\u0644\u0645\u0627\u0621 \u0644\u062a\u0646\u0638\u064a\u0641 \u0627\u0644\u0633\u062c\u0627\u062f\u0629 \u0628\u0627\u0644\u0645\u0643\u0646\u0633\u0629.',
  ground_material_clean_direction_alert:
    '\u0642\u0645 \u0628\u062a\u0639\u064a\u064a\u0646 \u0627\u062a\u062c\u0627\u0647 \u0627\u0644\u0623\u0631\u0636\u064a\u0629 \u0644\u062a\u0639\u0645\u0644 \u0647\u0630\u0647 \u0627\u0644\u0648\u0638\u064a\u0641\u0629. \u0627\u0636\u063a\u0637 \u0639\u0644\u0649 "\u0645\u0648\u0627\u0641\u0642" \u0644\u0625\u0639\u062f\u0627\u062f\u0647\u0627.',
  clean_route_setting_title: '\u0627\u0644\u0645\u0633\u0627\u0631',
  map_object_desc_general_1:
    '\u064a\u0645\u0643\u0646 \u0644\u0644\u0631\u0648\u0628\u0648\u062a \u062a\u062d\u062f\u064a\u062f \u0648\u062a\u062c\u0646\u0628 \u0645\u062c\u0645\u0648\u0639\u0629 \u0648\u0627\u0633\u0639\u0629 \u0645\u0646 \u0627\u0644\u0639\u0648\u0627\u0626\u0642 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0644\u064a\u0632\u0631 \u0627\u0644\u062e\u0637\u064a \u0627\u0644\u0645\u062f\u0639\u0648\u0645 \u0645\u0646 \u0645\u062c\u0645\u0648\u0639\u0629 \u0645\u0646 \u0623\u062c\u0647\u0632\u0629 \u0627\u0644\u0627\u0633\u062a\u0634\u0639\u0627\u0631 \u0627\u0644\u0623\u062e\u0631\u0649.',
  robot_play_soundpackage_exception:
    '\u0641\u0634\u0644 \u0627\u0644\u0627\u0633\u062a\u0645\u0627\u0639 \u0627\u0644\u062a\u062c\u0631\u064a\u0628\u064a. \u062c\u0631\u0628 \u0627\u0633\u062a\u062e\u062f\u0627\u0645\u0647 \u0645\u0628\u0627\u0634\u0631\u0629\u064b.',
  offline_map_guide_title: '\u062e\u0631\u064a\u0637\u0629 \u062f\u0648\u0646 \u0627\u062a\u0635\u0627\u0644',
  offline_map_guide_desc1:
    '\u0633\u064a\u062a\u0645 \u0625\u064a\u0642\u0627\u0641 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u062c\u0647\u0627\u0632 \u062a\u0644\u0642\u0627\u0626\u064a\u064b\u0627 \u0625\u0630\u0627 \u062a\u064f\u0631\u0643 \u0628\u062f\u0648\u0646 \u0634\u062d\u0646 \u0644\u0645\u062f\u0629 \u062a\u0632\u064a\u062f \u0639\u0646 12 \u0633\u0627\u0639\u0629. \u064a\u062a\u064a\u062d \u0644\u0643 \u062a\u0645\u0643\u064a\u0646 \u062e\u0631\u064a\u0637\u0629 \u062f\u0648\u0646 \u0627\u062a\u0635\u0627\u0644 \u0645\u0639\u0631\u0641\u0629 \u0645\u0643\u0627\u0646 \u0627\u0644\u062c\u0647\u0627\u0632 \u0642\u0628\u0644 \u0642\u0637\u0639 \u0627\u062a\u0635\u0627\u0644\u0647 \u0628\u0627\u0644\u0634\u0628\u0643\u0629.',
  offline_map_guide_desc2:
    '*\u0633\u064a\u0643\u0648\u0646 \u0628\u0625\u0645\u0643\u0627\u0646\u0643 \u062a\u0639\u0637\u064a\u0644 \u0647\u0630\u0647 \u0627\u0644\u0648\u0638\u064a\u0641\u0629 \u0645\u0646 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0641\u064a\u0645\u0627 \u0628\u0639\u062f.',
  offline_map_tips_title: '\u0645\u0648\u0642\u0639 \u0627\u0644\u062c\u0647\u0627\u0632 \u0642\u0628\u0644 \u0642\u0637\u0639 \u0627\u0644\u0627\u062a\u0635\u0627\u0644',
  offline_map_tips_subtitle:
    '\u0643\u0627\u0646 \u0627\u0644\u062c\u0647\u0627\u0632 \u0647\u0646\u0627 \u0642\u0628\u0644 \u0642\u0637\u0639 \u0627\u0644\u0627\u062a\u0635\u0627\u0644. \u0636\u0639\u0647 \u0639\u0644\u0649 \u0627\u0644\u0642\u0627\u0639\u062f\u0629 \u0645\u0631\u0629 \u0623\u062e\u0631\u0649 \u0648\u0633\u064a\u0628\u062f\u0623 \u062a\u0634\u063a\u064a\u0644\u0647 \u0648\u062a\u0648\u0635\u064a\u0644\u0647 \u0628\u0627\u0644\u0634\u0628\u0643\u0629 \u062a\u0644\u0642\u0627\u0626\u064a\u064b\u0627.',
