  carpet_clean_mode_setting_deepclean_desc2:
    '\u064a\u0646\u0637\u0628\u0642 \u0639\u0644\u0649 \u0627\u0644\u0633\u062c\u0627\u062f \u0643\u0628\u064a\u0631 \u0627\u0644\u062d\u062c\u0645. \u0639\u0646\u062f \u0627\u0643\u062a\u0634\u0627\u0641 \u0633\u062c\u0627\u062f\u0629\u060c \u064a\u062a\u0645 \u0631\u0641\u0639 \u0648\u062d\u062f\u0629 \u0627\u0644\u0645\u0645\u0633\u062d\u0629 \u0648\u0625\u064a\u0642\u0627\u0641 \u062a\u062f\u0641\u0642 \u0627\u0644\u0645\u0627\u0621 \u0644\u062a\u0646\u0638\u064a\u0641 \u0627\u0644\u0633\u062c\u0627\u062f \u0628\u0627\u0644\u0645\u0643\u0646\u0633\u0629. \u0628\u0639\u062f \u062a\u0646\u0638\u064a\u0641 \u0627\u0644\u0633\u062c\u0627\u062f \u0628\u0627\u0644\u0645\u0643\u0646\u0633\u0629\u060c \u064a\u0642\u0648\u0645 \u0627\u0644\u0631\u0648\u0628\u0648\u062a \u0628\u0639\u062f \u0630\u0644\u0643 \u0628\u062a\u0646\u0638\u064a\u0641 \u0627\u0644\u0645\u0646\u0627\u0637\u0642 \u0627\u0644\u0623\u062e\u0631\u0649 \u0628\u0627\u0644\u0645\u0643\u0646\u0633\u0629. \u0648\u0628\u0639\u062f \u062a\u0646\u0638\u064a\u0641 \u0627\u0644\u063a\u0631\u0641\u0629\u060c \u064a\u0642\u0648\u0645 \u0627\u0644\u0631\u0648\u0628\u0648\u062a \u0628\u062a\u0646\u0638\u064a\u0641 \u0627\u0644\u0633\u062c\u0627\u062f \u0628\u0634\u0643\u0644 \u0645\u0646\u0641\u0635\u0644 \u0641\u064a \u0643\u0644 \u063a\u0631\u0641\u0629. *\u0644\u0627 \u064a\u0634\u0645\u0644 \u0630\u0644\u0643 \u0627\u0644\u062d\u0635\u064a\u0631.',
